import React from "react";
import InputFields from "../../Components/InputField";
import SideImage from "./Components/SideImageArea/SideImage";

const Login = () => {
  return (
    <div style={{ display: "flex", minHeight: "100vh" }}>
      <div
        style={{
          width: "50%",
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
        }}
      >
        <div>
          <SideImage />
        </div>
      </div>
      <div
        style={{
          width: "50%",
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          backgroundColor: "#C3C9D2",
        }}
      >
        <InputFields placeholder={"User Name"} />
      </div>
    </div>
  );
};

export default Login;
